import json
import re
from qianfan import Qianfan


def generate_json_list(system_content: str, user_content: str) -> dict:
    client = Qianfan(
        # 方式一：使用安全认证AK/SK鉴权
        # 替换下列示例中参数，安全认证Access Key替换your_iam_ak，Secret Key替换your_iam_sk，如何获取请查看<url id="cuaui04r4djutili84s0" type="url" status="parsed" title="如何获取AKSK - 相关参考Reference | 百度智能云文档" wc="1709"><url id="" type="url" status="" title="" wc=""><url id="" type="url" status="" title="" wc="">https://cloud.baidu.com/doc/Reference/s/9jwvz2egb</url></url></url>
        # access_key="your_iam_ak",
        # secret_key="your_iam_sk",
        # app_id="", # 选填，不填写则使用默认appid

        # 方式二：使用API Key值鉴权
        # 替换下列示例中参数，将your_APIKey替换为真实值，如何获取API Key请查看<url id="cuaui04r4djutili84sg" type="url" status="parsed" title="认证鉴权 - ModelBuilder" wc="8172"><url id="" type="url" status="" title="" wc=""><url id="" type="url" status="" title="" wc="">https://cloud.baidu.com/doc/WENXINWORKSHOP/s/Um2wxbaps#步骤二-获取api-key或bearertoken值</url></url></url>
        # api_key="your_APIKey"
        # app_id="", # 选填，不填写则使用默认appid
    )

    max_attempts = 3  # 最大尝试次数
    attempt = 0
    while attempt < max_attempts:
        try:
            completion = client.chat.completions.create(
                model="ernie-speed-128k",  # 指定特定模型
                messages=[
                    {'role': 'system', 'content': system_content},
                    {'role': 'user', 'content': user_content}
                ]
            )

            result = completion.choices[0].message.content

            # 使用正则表达式提取JSON部分
            json_match = re.search(r'\{.*\}', result)
            if json_match:
                json_data = json.loads(json_match.group())
                return json_data
            else:
                print("No JSON found, retrying...")
        except Exception as e:
            print(f"Error occurred: {e}, retrying...")
        attempt += 1

    print("Failed to get valid JSON after multiple attempts")
    return {}


